import React from 'react';
import { Paper, Typography, List, ListItem, ListItemText } from '@mui/material';

const LeagueGoals = ({ data }) => {
  const sortedLeagues = Object.entries(data).sort((a, b) => b[1] - a[1]);

  return (
    <Paper style={{ padding: '20px', backgroundColor: 'rgba(10, 25, 47, 0.7)' }}>
      <Typography variant="h5" gutterBottom style={{ color: '#1E90FF' }}>
        Goles por Liga
      </Typography>
      <List>
        {sortedLeagues.map(([league, goals]) => (
          <ListItem key={league}>
            <ListItemText 
              primary={league} 
              secondary={`${goals} goles`}
              primaryTypographyProps={{ style: { color: '#FFFFFF' } }}
              secondaryTypographyProps={{ style: { color: '#4682B4' } }}
            />
          </ListItem>
        ))}
      </List>
    </Paper>
  );
};

export default LeagueGoals;
